import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import ProductCard from "./components/ProductCard";

// Главная страница
const HomePage = ({ products, addToCart }) => {
    return (
        <div style={styles.container}>
            <h2 style={styles.title}>Почему мы лучшие</h2>
            <div style={styles.whyUs}>
                <p style={styles.text}>
                    Мы - лидер на рынке бытовой техники, потому что предлагаем не только широкий ассортимент товаров, но и высокий уровень сервиса. Наша компания предлагает конкурентоспособные цены, быструю доставку и гарантию на все товары. Мы постоянно следим за новыми трендами в сфере технологий и стремимся предоставлять нашим клиентам только самые лучшие и современные продукты.
                </p>
                <ul style={styles.list}>
                    <li>• Широкий ассортимент</li>
                    <li>• Отличные цены</li>
                    <li>• Быстрая доставка</li>
                    <li>• Профессиональная поддержка</li>
                    <li>• Гарантия качества</li>
                </ul>
            </div>
            <h2 style={styles.title}>Наши товары</h2>
            <div style={styles.productGrid}>
                {products.map((product) => (
                    <ProductCard key={product.id} product={product} onAddToCart={addToCart} />
                ))}
            </div>
        </div>
    );
};

// Страница "О нас"
const AboutPage = () => {
    return (
        <div style={styles.aboutContainer}>
            <h2 style={styles.title}>О нас</h2>
            <p style={styles.text}>
                Добро пожаловать в нашу компанию! Мы специализируемся на продаже бытовой техники и являемся лидерами на рынке благодаря высокому качеству сервиса и широкому ассортименту товаров. Наша цель - предоставить клиентам самые современные и удобные решения для вашего дома.
            </p>
        </div>
    );
};

const App = () => {
    const [cart, setCart] = useState([]);

    const products = [
        { id: 1, name: "Холодильник", price: 50000, image: "https://via.placeholder.com/300" },
        { id: 2, name: "Стиральная машина", price: 30000, image: "https://via.placeholder.com/300" },
        { id: 3, name: "Микроволновка", price: 10000, image: "https://via.placeholder.com/300" },
        { id: 4, name: "Пылесос", price: 15000, image: "https://via.placeholder.com/300" },
        { id: 5, name: "Телевизор", price: 40000, image: "https://via.placeholder.com/300" },
        { id: 6, name: "Утюг", price: 5000, image: "https://via.placeholder.com/300" },
    ];

    const addToCart = (product) => {
        setCart((prevCart) => {
            const existingProduct = prevCart.find((item) => item.id === product.id);
            if (existingProduct) {
                return prevCart.map((item) =>
                    item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
                );
            } else {
                return [...prevCart, { ...product, quantity: 1 }];
            }
        });
    };

    return (
        <Router>
            <Navbar />
            <Routes>
                <Route
                    path="/"
                    element={<HomePage products={products} addToCart={addToCart} />}
                />
                <Route path="/about" element={<AboutPage />} />
            </Routes>
            <Footer />
        </Router>
    );
};

const styles = {
    container: {
        padding: "20px",
    },
    title: {
        textAlign: "center",
        fontSize: "28px",
        fontWeight: "bold",
        marginBottom: "20px",
    },
    whyUs: {
        marginBottom: "40px",
        backgroundColor: "#f9f9f9",
        padding: "20px",
        borderRadius: "10px",
        boxShadow: "0 4px 8px rgba(0, 0, 0, 0.1)",
    },
    text: {
        fontSize: "18px",
        lineHeight: "1.6",
        marginBottom: "20px",
    },
    list: {
        listStyleType: "none",
        padding: "0",
        fontSize: "16px",
        lineHeight: "1.8",
    },
    productGrid: {
        display: "grid",
        gridTemplateColumns: "repeat(3, 1fr)", // Три карточки в ряду
        gap: "20px", // Расстояние между карточками
        justifyContent: "center",
    },
    aboutContainer: {
        padding: "20px",
        backgroundColor: "#f2f2f2",
        borderRadius: "10px",
        margin: "20px auto",
        maxWidth: "800px",
        boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    },
};

export default App;
